			shellPath = /bin/sh;
			shellScript = "# Type a script or drag a script file from your workspace to insert its path.\n# 在最新版中simulator包含arm64架构，需要build Setting -> Excluded Architectus 中排除simulator的arm64才能合并成功，可用xcframework来替代\n# Author:李建平\nFMK_NAME=DMBZSdk\nOUTFPSDK_DIR=~/Desktop/${FMK_NAME}_FMWK_$(date \"+%Y%m%d%H%M%S\")/${FMK_NAME}.framework\nWRK_DIR=build\nDEVICE_DIR=${WRK_DIR}/Release-iphoneos/${FMK_NAME}.framework\nSIMULATOR_DIR=${WRK_DIR}/Release-iphonesimulator/${FMK_NAME}.framework\n\n# build 真机+模拟器 的静态库framework\n#xcodebuild -configuration \"Release\" -target \"${FMK_NAME}\" -sdk iphoneos clean build\n\nxcodebuild -configuration \"Release\" -target \"${FMK_NAME}\" -sdk iphoneos \nxcodebuild -configuration \"Release\" -target \"${FMK_NAME}\" -sdk iphonesimulator \n\n# 删除已存在的目录文件夹\nif [ -d \"${OUTFPSDK_DIR}\" ]\nthen\nrm -rf \"${OUTFPSDK_DIR}\"\nfi\n\n# 创建文件夹\nmkdir -p \"${OUTFPSDK_DIR}\"\n\n# 复制真机framework到目标文件夹\ncp -R \"${DEVICE_DIR}/\" \"${OUTFPSDK_DIR}/\"\n#cp -R \"${SIMULATOR_DIR}/\" \"${OUTFPSDK_DIR}/\"\n\n# Uses the Lipo Tool to merge both binary files (i386 + armv6/armv7) into one Universal final product.\n# 使用Lipo工具合并framework\nlipo -create \"${DEVICE_DIR}/${FMK_NAME}\" \"${SIMULATOR_DIR}/${FMK_NAME}\" -output \"${OUTFPSDK_DIR}/${FMK_NAME}\"\n\n# 删除工作目录临时文件\nrm -r \"${WRK_DIR}\"\n\n# 打开文件目录\nopen \"${OUTFPSDK_DIR}\"\n\n# 退出sh脚本\nexit 0\n";
